import { React } from "react";
import "./styles.css";

const Drawer = () => {
  return (
    <div class="drawer-container">
      <div class="drawer-menu-container">
        <button>Home</button>
        <button>Popular</button>
      </div>
    </div>
  );
};

export default Drawer;
